        "System.Description": "<div><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">We currently are dual-disclosing our fee changes effective\nApril 17 and for the April Zeus release, we\u2019ll need to start dual-disclosure on\nour May 5/21 fee changes, so I\u2019ve attached the following:</p><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">&nbsp;</p><p style=\"margin:0in 0in 0.0001pt 0.5in;font-size:11pt;font-family:Calibri, sans-serif;margin-left:.25in;text-indent:-.25in;\"><span style=\"\"><span style=\"\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span></span>Personal Accounts Schedule of Fees \u2013 4/17/2020\nand 5/21/2020 fee schedules combined</p><ol style=\"margin-bottom:0in;margin-top:0in;\" start=1 type=1>\n <ul style=\"margin-bottom:0in;margin-top:0in;\">\n  <li style=\"margin:0in 0in 0.0001pt 0.5in;font-size:11pt;font-family:Calibri, sans-serif;margin-left:-.25in;\"><span style=\"\">Changed Insufficient\n      Funds de minimus language per Compliance.</span></li>\n </ul></ol><ul style=\"margin-bottom:0in;\"><li>Changed ATM Inquiry fee from $2.00 to $2.50</li><li>Combined online banking stop payment and stop\npayment into just stop payment at $30</li><li>Changed collection fee to $50<br><br>&nbsp;</li></ul><p style=\"margin:0in 0in 0.0001pt 0.5in;font-size:11pt;font-family:Calibri, sans-serif;margin-left:.25in;text-indent:-.25in;\"><span style=\"\"><span style=\"\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span></span>Business Accounts Schedule of Fees \u20134/17/2020\nand 5/21/2020 fee schedules combined</p><ol style=\"margin-bottom:0in;margin-top:0in;\" start=2 type=1>\n <ul style=\"margin-bottom:0in;margin-top:0in;\">\n  <li style=\"margin:0in 0in 0.0001pt 0.5in;font-size:11pt;font-family:Calibri, sans-serif;margin-left:-.25in;\"><span style=\"\">Changed Insufficient\n      Funds de minimus language per Compliance.</span></li>\n  <li style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;margin-left:-.25in;\"><span style=\"\">Changed ATM Inquiry fee\n      from $2.00 to $2.50</span></li>\n  <li style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;margin-left:-.25in;\"><span style=\"\">Combined online banking\n      stop payment and stop payment into just stop payment at $30</span></li>\n  <li style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;margin-left:-.25in;\"><span style=\"\">Changed collection fee\n      to $50</span></li>\n </ul></ol><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">&nbsp;</p><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">&nbsp;</p><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">Please let me know if you have any questions.</p><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">&nbsp;</p><p style=\"margin:0in 0in 0.0001pt;font-size:11pt;font-family:Calibri, sans-serif;\">Thank you,</p><b><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,sans-serif;color:#444444;text-transform:uppercase;\">LISA HICKEY</span></b><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,sans-serif;color:#333333;\"><br>\nRetail Product Imp Manager I</span><br></div>",
